import React, { useState } from "react";
import Navbar from "../Components/Layouts/Navbar";

const NewEstablishmentForm = () => {
  const [formData, setFormData] = useState({
    name: "",
    address: "",
    description: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch(
        "https://nf-api.onrender.com/api/v1/holidaze/venues",
        {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify(formData),
        }
      );
      if (!response.ok) {
        throw new Error("Failed to create establishment");
      }

      setFormData({
        name: "",
        address: "",
        description: "",
      });
      alert("Establishment created successfully!");
    } catch (error) {
      console.error("Error creating establishment:", error);
      alert("Failed to create establishment. Please try again later.");
    }
  };

  return (
    <div>
      <h2>Create a New Establishment</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Name:</label>
          <input
            type="text"
            name="name"
            value={formData.name}
            onChange={handleChange}
          />
        </div>
        <div>
          <label>Address:</label>
          <input
            type="text"
            name="address"
            value={formData.address}
            onChange={handleChange}
          />
        </div>
        <div>
          <label>Description:</label>
          <textarea
            name="description"
            value={formData.description}
            onChange={handleChange}
          />
        </div>
        <button type="submit">Create Establishment</button>
      </form>
    </div>
  );
};

const AdminDashboard = () => {
  return (
    <div>
      <Navbar />
      <NewEstablishmentForm />
    </div>
  );
};

export default AdminDashboard;
